(2, '984ac79f-d71c-4d11-94f5-17f78c7a979f', 'Contact Us', '[google-map title=\"Contact Us\" title_class=\"map_contact\"]Daffodil Smart City[/google-map][contact-form][/contact-form]', 'Contact Us', NULL, 'contact-us', 1, 1, 1, '2023-11-20 01:20:23', '2023-11-28 02:52:28'),
(3, '7e045375-4cbe-4343-96ed-680b72c5ec16', 'Terms And Condition', '<p>Terms And Condition</p>', 'Terms And Condition', NULL, 'terms-and-condition', 1, 1, 1, '2023-11-20 22:32:16', '2023-11-26 22:34:57'),
(4, 'e8afb40b-77d5-4cc9-89ee-a2b5defedb78', 'Services', '<div class=\"page-header\" style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><h1 style=\"font-family:\'Open Sans\', sans-serif;font-size:2.5rem;line-height:1.2;\"><strong>Job Placement</strong></h1><p style=\"font-family:\'Open Sans\', sans-serif;font-size:2.5rem;line-height:1.2;\"> </p></div><div style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><p style=\"text-align:justify;\">With the aim of assisting DIU students with their job placements (part-time and full time), CDC searches for employment for them on a regular basis in newspapers, and on websites and through different online web portals. New vacancies are posted to the e-mail inboxes of DIU students so that they can apply for those positions. What’s more, CDC provides career counseling, and organizes training, workshops &amp; other relevant events to prepare DIU job seekers with the necessary skills and knowledge to appeal to recruiters. Moreover, CDC makes links and contacts with different employer organizations to promote the competences and abilities of DIU students for their consideration.</p><p style=\"text-align:justify;\"> </p><p>Full-time students who are not in a situation to spend all their time on internships are encouraged to seek part-time jobs. DIU policy is also to engage our current students in different part-time jobs on campus.</p><p> </p><p><span style=\"font-family:\'book antiqua\', palatino, serif;font-size:12pt;\"><strong style=\"font-weight:bolder;\">Please Click the following button to find recent Job Opportunities for You :</strong></span>  <a style=\"color:rgb(16,97,204);text-decoration:none;\" href=\"https://skill.jobs/\" rel=\"lightbox noopener noreferrer\" target=\"_blank\"><span style=\"font-family:impact, sans-serif;font-size:14pt;\">Job Opportunities for You</span></a></p><p><strong style=\"font-weight:bolder;\">Part-time Employment</strong></p><p>Requests are made to the Office for on- and off-campus part-time employment. If you wish to participate in this programme, you may apply by uploading your most recent resume online or drop it in at the CDC office. Your resume will be sent to employers as soon as jobs are available. Please note that first year students are not allowed to apply until the second semester of the academic year.</p><p><strong style=\"font-weight:bolder;\">Spot Recruitment</strong><br> </p><p>CDC arranges different spot interviews at on-campus recruitment events, which are directly conducted by various employer organizations. These help students get jobs without wasting time on formalities. As this event is very popular with students, CDC is trying to arrange more of them attended by more organizations.</p><p> </p><div class=\"page-header\" style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><h1 style=\"font-family:\'Open Sans\', sans-serif;font-size:2.5rem;line-height:1.2;\"><strong>Self-employment</strong></h1><p style=\"font-family:\'Open Sans\', sans-serif;font-size:2.5rem;line-height:1.2;\"> </p></div><div style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><p>Given the ever-changing nature of society as well as the global economic scenario, CDC has taken the initiative to promote the careers of DIU students not only as job seekers but also to develop them as entrepreneurs. Accordingly, CDC has re-arranged all its support services in order to focus specifically on entrepreneurship development. CDC is even organizing special courses on this topic, such as its highly valued Certificate Course on Entrepreneurship Development (CCED).</p></div></div>', 'Services', NULL, 'services', 1, 1, 1, '2023-11-20 22:32:39', '2023-11-26 22:34:40'),
(5, 'a3952ec1-e8da-4eda-97c0-9138f3c01e12', 'Career Resource', '<p>Career Resource</p>', 'Career Resource', NULL, 'career-resource', 1, 1, 1, '2023-11-20 22:32:56', '2023-11-26 22:34:57'),
(6, '3e5e8d0a-90df-47d7-9b1a-ba973516f29e', 'For Employers', '<div class=\"page-header\" style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><h1 style=\"font-family:\'Open Sans\', sans-serif;font-size:2.5rem;line-height:1.2;\"><strong>Preface</strong></h1></div><div class=\"entry-header\" style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"> </div><div style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><p style=\"text-align:justify;\">‘Study on ICT Job Market in Bangladesh’ is the initiative of Daffodil International University (DIU) in association with Jobsbd.com.</p><p style=\"text-align:justify;\">Daffodil International University (DIU) started out in 2002 and has now developed an excellent reputation in the higher education arena of the country. DIU combines impressive modern facilities and a dynamic approach to teaching and research with its strength in combining resources and global networks. DIU is recognized in independent government assessments as one of top graded universities in Bangladesh. Since its foundation, the University has maintained its commitment to serving the nation.</p><p style=\"text-align:justify;\">Dr. Md. Sabur Khan, Honorable Chairman, BOT, DIU, has always focused on ensuring industry requirement based tertiary level education through a dynamic approach which combines teaching and research. He already introduced some unique programs, such as ‘Art of Living’, ‘Entrepreneurship Development’ and ‘Employability 360’ as rungs on the ladder towards success.</p><p style=\"text-align:justify;\">Ensuring 100% job placement for all DIU graduates is one of the great challenges for us. We have selected the Information and Communication Technology (ICT) industry of Bangladesh as our main priority in this area. And we are steadily expanding this to reach each and every industry.</p><p style=\"text-align:justify;\">DIU is compiling the study, ‘ICT Job Market in Bangladesh’, in association with Jobsbd.com. Besides coordinating the publication process, DIU will collate data and analyse ICT industry-specific information as well as Bangladesh’s economic outlook. Although professional participation is needed to ensure the accuracy of data analysis and presentation, this research is provided for everyday users/stakeholders.</p><p style=\"text-align:justify;\"> </p><div class=\"page-header\" style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><h1 style=\"font-family:\'Open Sans\', sans-serif;font-size:2.5rem;line-height:1.2;\"><strong>Objectives of the Study</strong></h1></div><div class=\"entry-header\" style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"> </div><div style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><p style=\"text-align:justify;\">In recent years, the Bangladeshi services sector has grown substantially which has led to a robust increase in domestic IT &amp; ITES service demand: currently the revenue from domestic IT services is almost twice the amount of the revenue from IT &amp; ITES exports. According to BASIS survey, there are over 800 registered software and ITES (IT Enabled Service) companies in Bangladesh. There are another few hundred unregistered small and home-based software and IT ventures doing business for both local and international markets. The total industry size is estimated to be around US$ 400 million. Approximately 70,000 professionals – the majority IT and other graduates – are employed in the industry. Though compared to other traditional mainstream industries, the contribution to overall employment creation is not especially high, if considered in terms of creating high quality employment (average monthly compensation over Tk. 15,000 per month), the software and IT service industry is surely one of the top graduate employment sectors in the country.</p><p style=\"text-align:justify;\">Through the ‘ICT Job Market in Bangladesh’ survey, the following facts &amp; figure should focus on the Information and Communication Technology (ICT) Industry of Bangladesh:</p><ol><li style=\"list-style-type:lower-alpha;padding-left:2rem;text-align:justify;\">job market outlook in different ICT sectors;</li><li style=\"list-style-type:lower-alpha;padding-left:2rem;text-align:justify;\">survey-based economic perceptions of job seekers and industry players;</li><li style=\"list-style-type:lower-alpha;padding-left:2rem;text-align:justify;\">the latest salary reports (average standard salary) of ICT professionals by industry (entry to mid-level, according to expertise arena);</li><li style=\"list-style-type:lower-alpha;padding-left:2rem;text-align:justify;\">average salary of ICT professionals in Bangladesh compared to English-speaking countries where placement opportunities are available for Bangladeshi ICT talent migration or soliciting;</li><li style=\"list-style-type:lower-alpha;padding-left:2rem;text-align:justify;\">national representatives of the ICT industry, trade bodies, business associations, professional associations and regulatory bodies</li><li style=\"list-style-type:lower-alpha;padding-left:2rem;text-align:justify;\">ICT members’/associations’ contribution to the total ICT revenue in the country.</li></ol><p style=\"list-style-type:lower-alpha;padding-left:2rem;text-align:justify;\"> </p><div class=\"page-header\" style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><h1 style=\"font-family:\'Open Sans\', sans-serif;font-size:2.5rem;line-height:1.2;\"><strong>Expected Outcome</strong></h1></div><div class=\"entry-header\" style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"> </div><div style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><p style=\"text-align:justify;\">The study aims to analyze the job market outlook in different ICT sectors and to introduce industry-oriented practical learning programs through academic curricula to tertiary level education in Bangladesh.</p><p style=\"text-align:justify;\">To implement the idea of digital Bangladesh, we need to address and prepare comprehensive data about the job market in the IT and ITES industries of the country. In this connection, DIU has taken an initiative to study the ICT job market in Bangladesh to assist all the stakeholders in the sector by providing information on salaries earned by ICT professionals in Bangladesh. The study will include data analysis on relevant areas regarding the job market in Bangladesh, like the average monthly salary of ICT professionals, industry clusters, job category, job function, employment size and years of working experience, geographical location and gender.</p><p style=\"text-align:justify;\">The Digital Bangladesh vision needs to be translated into achievable policies based on available resources, which should be disbursed in a manner that is aligned with the industry’s needs, leveraging ICT growth. At the business-environment level, there is a need to bring the government closer to the operational needs of the industry.</p><p style=\"text-align:justify;\">We believe that this study will contribute significantly to Bangladesh Govt. views by creating skilled manpower to meet the upcoming challenges of the ICT Industry in the context of global job placement.</p><p style=\"text-align:justify;\"> </p><div class=\"page-header\" style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><h1 style=\"font-family:\'Open Sans\', sans-serif;font-size:2.5rem;line-height:1.2;\"><strong>Survey Methodology</strong></h1></div><div class=\"entry-header\" style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"> </div><div style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><p>In order to support this initiative of DIU and Jobsbd.com, Ministry of Post, Telecommunications and ICT, Government of Bangladesh, Bangladesh Association of Software &amp; Information Services (BASIS) and Bangladesh Computer Samity (BCS) have already promised their collaboration.</p><p>Through direct door to door Corporate House Survey conducted by trained professional enumerators (DIU Volunteer Student Group) using 384 random sampling survey methods of every segment of the ICT Industry, we will ensure the following methodology:</p><ol><li style=\"list-style-type:lower-alpha;padding-left:2rem;\">Questionnaire Compilation</li><li style=\"list-style-type:lower-alpha;padding-left:2rem;\">Focus Group Study</li><li style=\"list-style-type:lower-alpha;padding-left:2rem;\">Enumerator Grooming Program</li><li style=\"list-style-type:lower-alpha;padding-left:2rem;\">Pilot Survey Study</li><li style=\"list-style-type:lower-alpha;padding-left:2rem;\">Expert Review</li><li style=\"list-style-type:lower-alpha;padding-left:2rem;\">Data Compiling and Report Writing</li></ol><p>Publication of the Study</p><p> </p></div></div></div></div>', 'For Employers', NULL, 'for-employers', 1, 1, 1, '2023-11-20 22:33:10', '2023-11-26 22:40:10'),
(7, 'b46534ff-e559-44d5-9515-dd2459365775', 'Job Notice Board', '<p>Job Notice Board</p>', 'Job Notice Board', NULL, 'job-notice-board', 1, 1, 1, '2023-11-20 22:33:29', '2023-11-26 22:34:57'),
(8, 'a0040ecc-a44b-4721-9753-452bc632b3c7', 'News &amp; Events', '<p>News &amp; Events</p>', 'News & Events', NULL, 'news-events-1', 1, 1, 1, '2023-11-20 22:33:43', '2023-11-26 22:34:57'),
(9, '16953912-0a3d-4d8d-80bd-05d44c8fc89a', 'Explore More', '<p>Explore More</p>', 'Explore More', NULL, 'explore-more', 1, 1, 1, '2023-11-20 22:33:56', '2023-11-26 22:34:57'),
(10, 'f39dbaea-0530-45c3-aef2-f74149a64a5c', 'About CDC', '<div class=\"page-header\" style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><h1 style=\"font-family:\'Open Sans\', sans-serif;font-size:2.5rem;line-height:1.2;\"><strong>History</strong></h1></div><div style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><p>The Career Development Center (CDC) of Daffodil International University (DIU) was established in 2005 with the aim of providing essential technical assistance and academic support to DIU students so that they can gain employment skills and present themselves in the job market (both locally and internationally) with the required level of efficiency. To attain this objective, CDC has been trying to co-op itself with the latest demands and requirements of the job market; and accordingly the Center has made its best effort to extend useful practical ideas, knowledge and skills to DIU students.</p><p> </p><div class=\"page-header\" style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><h1 style=\"font-family:\'Open Sans\', sans-serif;font-size:2.5rem;line-height:1.2;\"><strong>Vision &amp; Mission</strong></h1></div><div style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><p><strong style=\"font-weight:bolder;\">Vision</strong></p><p>To deliver high-quality, educated youth for the job market as well as to nurture quality entrepreneurs for the development of business and the economy of the country.</p><p><strong style=\"font-weight:bolder;\">Mission</strong></p><ul><li style=\"padding-left:2rem;\">Develop DIU students with proper skills and knowledge so that they can compete in the job market with the highest rates of success;</li><li style=\"padding-left:2rem;\">Provide proper counseling and advice to DIU students so that they can find their best possible career with maximum satisfaction;</li><li style=\"padding-left:2rem;\">Develop close and continuous contact and relationships with different government-, non-government and international organizations with the aim of placing increasing numbers of DIU students in those organizations;</li><li style=\"padding-left:2rem;\">Arranging internship opportunities for DIU students in large, modern and multifarious organizations at home and abroad;</li><li style=\"padding-left:2rem;\">Improve the confidence level of DIU students through proper orientation and guidance to meet their career requirements.</li></ul></div></div><div class=\"article-footer-wrap\" style=\"background-color:rgb(255,255,255);color:rgb(33,37,41);font-family:\'Open Sans\', sans-serif;font-size:14px;font-style:normal;font-weight:300;word-spacing:0px;\"><div class=\"article-footer-top\" style=\"width:1116px;\"><div class=\"helix-social-share\"><div class=\"helix-social-share-icon\"><div> </div></div></div></div></div><p><br> </p>', 'About CDC', NULL, 'about-cdc', 1, 1, 1, '2023-11-20 22:34:24', '2023-11-26 22:27:47'),
(11, '9e02c9d1-0b13-4111-86ba-f819153f17d0', 'Sign Up', '<p>Sign Up</p>', 'Sign Up', NULL, 'sign-up', 1, 1, 1, '2023-11-20 22:34:38', '2023-11-26 22:35:11'),
