(1, '75e95ee2-9a6c-454e-8625-16fb59d36b86', 'On Campus Recruitment', NULL, 'i-doc-1700557059.webp', NULL, NULL, '2023-01-01', NULL, 'on-campus-recruitment', '<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard. Students of this section are in their first stage of learning where they begin their preschool and early learning. Children being very young at this stage have impressionable minds that need a caring environment. Starting with training to hold a pencil through games, songs, storytelling and a lot of innovativeness, they end up being capable and confident pupils who can clearly express themselves both in speech and in writing.</p>', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard', NULL, NULL, 1, 4, 1, NULL, '2023-11-20 01:20:23', '2023-11-21 02:57:39'),
