(3230, 1, 'en', 'Modules/KamrulDashboard/lang_v1', 'amount_for_unit_rp_tooltip', '<strong>Meaning how much the customer spent to get one reward points.</strong> <br><br> <strong>Example:</strong> If you set it as 10, then for every $10 spent by customer they will get one reward points. If the customer purchases for $1000 then they will get 100 reward points.', '2023-11-25 03:29:52', '2023-11-25 03:29:52'),
(3231, 1, 'en', 'Modules/KamrulDashboard/lang_v1', 'max_rp_per_order_tooltip', 'Maximum reward points customers can earn in one invoice. Leave it empty if you don’t want any such restrictions.', '2023-11-25 03:29:52', '2023-11-25 03:29:52'),
(3232, 1, 'en', 'Modules/KamrulDashboard/lang_v1', 'min_order_total_for_rp_tooltip', '<strong>The minimum amount the customer should spend to get reward points.</strong> <br><br> <strong>Example:</strong> If you set it as 100 then customer will get reward points only if there invoice total is greater or equal to 100. If invoice total is 99 then they won’t get any reward points. <br><br>You can set it as minimum 1.', '2023-11-25 03:29:52', '2023-11-25 03:29:52'),
(3233, 1, 'en', 'Modules/KamrulDashboard/lang_v1', 'redeem_amount_per_unit_rp_tooltip', '<strong> It indicates the redeem amount per point.</strong> <br><br> <strong>For example:</strong>If 1 point is $1 then enter the value as 1. If 2 points is $1 then enter the value as 0.50', '2023-11-25 03:29:52', '2023-11-25 03:29:52'),
(3234, 1, 'en', 'Modules/KamrulDashboard/lang_v1', 'min_order_total_for_redeem_tooltip', 'Minimum order total for which customers can redeem points. Leave it blank if you don’t need this restriction or you need to give something for free.', '2023-11-25 03:29:52', '2023-11-25 03:29:52'),
